<template bindable="console">
    <div class="panel panel-default">
        <div class="panel-heading">
            <h3 class="panel-title">${console.title}</h3>
        </div>
        <div class="panel-body">
            <div repeat.for="output of console.log">
                ${output}
            </div>
        </div>
        <div class="panel-footer">
            
        </div>
    </div>
</template>
